import React from 'react'
import {View,Text} from 'react-native'
import { StyleSheet, TouchableOpacity } from 'react-native-web'

export default function AboutPage(){
  return (
    <View style={styles.container}>
        <Text>어바웃페이지</Text>
        <View>
            <Image
                source={{uri:"https://firebasestorage.googleapis.com/v0/b/sparta-image.appspot.com/o/lecture%2FaboutImage.png?alt=media&token=13e1c4f6-b802-4975-9773-e305fc7475c4"}}
            />
            <Text>많은 내용을 간결하게 담아내려 노력했습니다!</Text>
            <Text>꼭 완주 하셔서 곡 여러분 것으로 만들어 가시길 바랍니다</Text>
            <TouchableOpacity>
                <Text>@chosen.1_errSum</Text>
            </TouchableOpacity>
        </View>
    </View>
      )
}

const styles = StyleSheet.create({
    container : {
        backgroundColor: 'blue'
    }
})
